import React from 'react';
import BootstrapTable from 'react-bootstrap-table-next';
import { Col } from 'react-bootstrap';


export const CountryAttr = ({ country }) => {
    if (!country || country.length == 0) {
        return <div></div>
    }
    console.log(country);
    const columns = [{
        dataField: 'code',
        text: 'Country Code'
    }, {
        dataField: 'name',
        text: 'Country Name'
    }, {
        dataField: 'surfacearea',
        text: 'Surface Area'
    }, {
        dataField: 'indepyear',
            text: 'Independence Year'
    }, {
        dataField: 'population',
            text: 'Population'
    }, {
        dataField: 'lifeexpectancy',
            text: 'Life Expectancy'
    }, {
        dataField: 'gnp',
            text: 'GNP'
    }, {
        dataField: 'gnpold',
            text: 'GNP(old)'
    }, {
        dataField: 'localname',
            text: 'Local Name'
        }, {
            dataField: 'governmentform',
            text: 'Government Form'
        }, {
            dataField: 'headofstate',
            text: 'Head of State'
        }, {
            dataField: 'capital',
            text: 'Capital'
        }, {
            dataField: 'code2',
            text: 'Country Code 2'
        }];

    return (
        <BootstrapTable keyField="code" data={country} columns={columns} className="App-table" />
    )
}
